import logo from './logo.svg';
import { Component } from 'react';
import './App.css';


class App extends Component{

 constructor(){
   super();

   this.state={
     name: 'Sam'
   }
 }

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
           Hi {state.name}
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }

}

export default App;
